import React, { useEffect } from 'react';
import L from 'leaflet';
import 'leaflet/dist/leaflet.css';

const Map = () => {
    useEffect(() => {
        // Tạo bản đồ với Leaflet
        const map = L.map('map').setView([21.028511, 105.804817], 13); // Vị trí Hà Nội

        // Thêm tile từ OpenStreetMap
        L.tileLayer('https://tile.openstreetmap.org/{z}/{x}/{y}.png', {
            attribution: '&copy; <a href="https://www.openstreetmap.org/copyright">OpenStreetMap</a> contributors',
        }).addTo(map);

        // Thêm marker tại Hà Nội
        L.marker([21.028511, 105.804817])
            .addTo(map)
            .bindPopup('Hà Nội, Việt Nam.<br> Đây là vị trí được tùy chỉnh.')
            .openPopup();
    }, []);

    return (
        <div id="map" style={{ height: '500px', width: '100%' }}>
            {/* Bản đồ sẽ được hiển thị trong div này */}
        </div>
    );
};

export default Map;
